import React from "react";
import { NavLink } from "react-router-dom";
import "./SideNav.css";

const SideNav = () => {
  return (
    <div className="sidenav">
      <h2 className="sidenav-title">UTHAKHANA BHIKHU SANGA</h2>
      <nav>
        <NavLink to="/photos" className="sidenav-link">
          Photos
        </NavLink>
        <NavLink to="/videos" className="sidenav-link">
          Videos
        </NavLink>
        <NavLink to="/ambedkar-philosophy" className="sidenav-link">
          Ambedkar Philosophy
        </NavLink>
        <NavLink to="/dhamadeshana" className="sidenav-link">
          Dhamadeshana
        </NavLink>
      </nav>
    </div>
  );
};

export default SideNav;
